If active, the status is set automatically set to Credit Hold, if the Total Open Balance (including Vendor activities)  is higher then the Credit Limit. It is set to Credit Watch, if above 90% of the Credit Limit and Credit OK otherwise.', 'Credit Management is inactive if Credit Status is No Credit Check, Credit Stop or if the Credit Limit is 0.
If active, the status is set automatically set to Credit Hold, if the Total Open Balance (including Vendor activities)  is higher then the Credit Limit. It is set to Credit Watch, if above 90% of the Credit Limit and Credit OK otherwise.', 'La gestion du crédit est inactive si l''état du crédit n''est pas une vérification de crédit, un arrêt de crédit ou si la limite de crédit est de 0.
S''il est actif, le statut est défini automatiquement sur Credit Hold, si le solde ouvert total (y compris les activités des fournisseurs) est plus élevé que la limite de crédit. Il est réglé sur Credit Watch, si plus de 90% de la limite de crédit et du crédit OK Ether.');
